import * as React from 'react';
import Grid from '@mui/material/Grid';
import IconButton from '@mui/material/IconButton';
import CallIcon from '@mui/icons-material/Call';
import '../ComponentStyle/Participant.css';

function Userscreen() {
  const buttons = [
    <IconButton key="1" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="2" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="3" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="4" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="5" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="6" aria-label="call" color="primary"><CallIcon /></IconButton>,
    <IconButton key="7" aria-label="call" color="primary"><CallIcon /></IconButton>,
  ];

  return (
    <Grid container style={{ height: '100vh', position: 'fixed' }}>
      <Grid item xs={12} style={{ height: '50%', background: 'red', border: '1px solid white' }}>
        <Grid container style={{ height: '100%' }}>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant1</div>
          </Grid>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant1</div>
          </Grid>
        </Grid>
      </Grid>
      <Grid item xs={12} style={{ height: '50%', position: 'relative', border: '1px solid white' }}>
        <Grid container style={{ height: '100%', position: 'relative' }}>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant1</div>
          </Grid>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant1</div>
          </Grid>
          <Grid item xs={12} style={{ position: 'absolute', bottom: 0 }}>
            <Grid container spacing={2} justifyContent="center">
              {buttons}
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

export default Userscreen;
